class ChatProcessor {
    constructor(createChatBotMessage) {
        this.createChatBotMessage = createChatBotMessage;
    }

    process(newMessage, allMessages) {
        // Here, you can add any logic you want to analyze the messages.

        console.log("New Message:", newMessage);
        console.log("All Messages:", allMessages);
        // Default reply if no conditions are met:
        return this.createChatBotMessage("I didn't understand that.");
    }
}

export default ChatProcessor;
